import React from "react";
import { MDBContainer, Button } from "mdbreact";
import DocsLink from "../components/docsLink";
import Details from "./pages/Details";

const RegStudentsPage = () => {
  return (
    <div>
    <MDBContainer className="mt-5">
      <DocsLink
        title="Registered students"

      />
      <p className=" text-center font-weight-bold">
        OOPS!!<br></br>
        NO DATA
      </p>
      <p className="text-center font-weight-bold">
        "To be continued.."
      </p>
      <section class="container">
            <Button color="primary" onClick={this.toggle}>Launch demo modal</Button>
            <div class="list-group mt-5">
                <button type="button" class="list-group-person list-group-person-action active">
                  People in Stock 
                </button>
                { this.renderPerson() }
              </div>

            {/*condition ? whentrue : whenfalse

            { this.state.isPersonSelected ? 
              <Details 
                person={this.state.person}
                personToRemove={this.removePerson}/> 

                :

              <></>
            }*/}
        </section>

    </MDBContainer>
    </div>
  );
}

export default RegStudentsPage;
